description:
Apache Skies is a four-issue sequel to 2000's Blaze of Glory, published in 2002.  After the death of the Apache Kid, the Rawhide Kid joins forces with the new Apache Kid to find the killer.

Written by John Ostrander and drawn by Leonardo Manco.


